import React, { useState } from 'react';
import { Container, Typography, TextField, Button, Box, Checkbox, FormControlLabel } from '@mui/material';

function SignUp() {
  const [formData, setFormData] = useState({
    fullName: '',
    email: '',
    password: '',
    agreeToTerms: false,
    agreeToPrivacy: false,
    country: '',
    state: '',
    zipCode: '',
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission, such as sending data to the server
    console.log(formData);
  };

  return (
    <Container maxWidth="sm" sx={{ paddingY: 8 }}>
      <Typography variant="h4" align="center" sx={{ marginBottom: 4, color: '#2a5e4f' }}>
        Create Your Account
      </Typography>
      <form onSubmit={handleSubmit}>
        <Box sx={{ marginBottom: 4 }}>
          <Typography variant="h6" sx={{ color: '#2a5e4f', marginBottom: 2 }}>
            Basic Information
          </Typography>
          <TextField
            fullWidth
            label="Full Name"
            name="fullName"
            value={formData.fullName}
            onChange={handleChange}
            variant="outlined"
            sx={{ marginBottom: 2 }}
            required
          />
          <TextField
            fullWidth
            label="Email"
            name="email"
            type="email"
            value={formData.email}
            onChange={handleChange}
            variant="outlined"
            sx={{ marginBottom: 2 }}
            required
          />
          <TextField
            fullWidth
            label="Password"
            name="password"
            type="password"
            value={formData.password}
            onChange={handleChange}
            variant="outlined"
            required
          />
        </Box>

        <Box sx={{ marginBottom: 4 }}>
          <Typography variant="h6" sx={{ color: '#2a5e4f', marginBottom: 2 }}>
            Agreements
          </Typography>
          <FormControlLabel
            control={
              <Checkbox
                name="agreeToTerms"
                checked={formData.agreeToTerms}
                onChange={handleChange}
                required
              />
            }
            label="I agree to the Terms of Service"
          />
          <FormControlLabel
            control={
              <Checkbox
                name="agreeToPrivacy"
                checked={formData.agreeToPrivacy}
                onChange={handleChange}
                required
              />
            }
            label="I agree to the Privacy Policy"
          />
        </Box>

        <Box sx={{ marginBottom: 4 }}>
          <Typography variant="h6" sx={{ color: '#2a5e4f', marginBottom: 2 }}>
            Location Information
          </Typography>
          <TextField
            fullWidth
            label="Country"
            name="country"
            value={formData.country}
            onChange={handleChange}
            variant="outlined"
            sx={{ marginBottom: 2 }}
            required
          />
          <TextField
            fullWidth
            label="State"
            name="state"
            value={formData.state}
            onChange={handleChange}
            variant="outlined"
            sx={{ marginBottom: 2 }}
            required
          />
          <TextField
            fullWidth
            label="Zip Code"
            name="zipCode"
            value={formData.zipCode}
            onChange={handleChange}
            variant="outlined"
            required
          />
        </Box>

        <Button
          variant="contained"
          type="submit"
          fullWidth
          sx={{
            backgroundColor: '#2a5e4f',
            color: '#ffffff',
            paddingY: 1.5,
            borderRadius: '25px',
            boxShadow: '0px 4px 10px rgba(0, 0, 0, 0.2)',
            '&:hover': { backgroundColor: '#204c3d' },
          }}
        >
          Create Account
        </Button>
      </form>
    </Container>
  );
}

export default SignUp;
